import React, { Component } from 'react'
import Box from './Box'

class App extends Component{


  render(){

  const info  = [

    {name : "Leo",          img: 'https://picsum.photos/250',    job:"Frontend",             phone: "+544323412",     email:"msds@gmail.com",            website: "leo.com"},
    {name : "Micheal",      img: 'https://picsum.photos/251',    job:"Backend",              phone: "+345522212",     email:"micheal@gmail.com",         website: "micheal.com"},
    {name : "Ali Akbar",    img: 'https://picsum.photos/252',    job:"Frontend",             phone: "",    email:"ali.akbar@myakbar.com",     website: "myakbar.com"},
    {name : "Johnny Depp",  img: 'https://picsum.photos/252',    job:"Frontend",             phone: "+9133223412",    email:"ali.akbar@myakbar.com",     website: "myakbar.com"},
    {name : "Mino",         img: 'https://picsum.photos/253',    job:"Graphical Designer",   phone: "+544323412",     email:"survival@gmail.com",        website: "leo.com"},
    {name : "Freddie",      img: 'https://picsum.photos/253',    job:"Graphical Designer",   phone: "",     email:"survival@gmail.com",        website: "leo.com"},

  ]

  const displayInfo = info.map(  person => {
    return <Box
    name =      { person.name    }
    img =       { person.img     }
    phone =     { person.phone   }
    job =       { person.job     }
    email =     { person.email   }
    website =   { person.website }

    />
  })

    return(
      <div className='mio'>

        {displayInfo}

      </div>
    )
  }


}


export default App
